style.css:
@namespace url(http://www.w3.org/1999/xhtml);







@-moz-document url-prefix(http://boards.4chan.org) {







body[bgcolor] {







background-color:#e9edf0 !important;







background-image:url(http://img84.imageshack.us/img84/9823/lillyd.png) !important;







background-position: right bottom !important;







background-repeat:no-repeat !important;







background-attachment:fixed !important







}















.postblock, .pages {















background-color: #ffffff !important;















}















.pages, .reply, .replyhl {















-moz-border-radius-bottomright: 0px !important;















-moz-border-radius-topright: 25px !important;















-moz-border-radius-topleft: 0px !important;















-moz-border-radius-bottomleft: 25px !important;















}







.replyhl{















background-color: #eab1b1 !important;















}















.reply {















background-color: #ffffff !important;















}















.reply, .replyhl {















border: 1px solid #000000 !important;















background-image:url(http://img84.imageshack.us/img84/9823/lillyd.png) !important;















background-position: bottom right !important;















background-repeat: no-repeat !important;















background-attachment: fixed !important;















/*Posts text font below*/















color: #000000 !important;















}















.unkfunc{















color: #1b5b1b !important;















}















.postername, .commentpostername {















background: inherit;















color: #72261a !important;















font-weight: 800 !important;















}















DIV[class="4chan_ext_thread"] > BLOCKQUOTE {















background-color:#eff5e6 !important;















}















}
